INSERT [dbo].[movies] ([movie_id], [title], [description], [trailer_url], [poster_url], [duration], [release_date], [status]) VALUES (2, N'Commando-3', N'Karan goes to London to stop a terrorist attack on India. A mysterious man is on an impending mission to attack the country from his base in London. Karan Singh Dogra sets out to hunt down the antagonist aided by the British Intelligence.', N'https://youtu.be/m-JIofHHU6s?si=7cEgaUdnLC53j_Rc', N'./assets/images/commando.jpeg', 195, CAST(N'1997-12-19' AS Date), N'Present')
INSERT [dbo].[movies] ([movie_id], [title], [description], [trailer_url], [poster_url], [duration], [release_date], [status]) VALUES (3, N'Gujjubhai Most Wanted', N'Gujjubhai and his son Khagesh try a shortcut to earn money which gets them into trouble with terrorists and cops. Gujjubhai and his son Khagesh try a shortcut to earn money which gets them into trouble with terrorists and cops.', N'https://youtu.be/rdu8aLHcVsU?si=uCPVF_DMRfBqCa_X', N'./assets/images/gujjubhai.jpeg', 148, CAST(N'2010-07-16' AS Date), N'Present')
INSERT [dbo].[movies] ([movie_id], [title], [description], [trailer_url], [poster_url], [duration], [release_date], [status]) VALUES (4, N'Joker', N'The Joker is a DC Comics supervillain who is a psychopathic criminal mastermind, anarchist, and nihilist. He is known for his colorful clothing, clown makeup, and menacing appearance. ', N'https://youtu.be/zAGVQLHvwOY?si=W4F88mCTo98mpOBo', N'./assets/images/m9.jpg', 122, CAST(N'2019-10-04' AS Date), N'Present')
INSERT [dbo].[movies] ([movie_id], [title], [description], [trailer_url], [poster_url], [duration], [release_date], [status]) VALUES (5, N'Avatar', N' It is set in the mid-22nd century, when humans are colonizing Pandora, a lush habitable moon of a gas giant in the Alpha Centauri star system, in order to mine the valuable unobtanium,a room-temperature superconductor mineral. ', N'https://youtu.be/d9MyW72ELq0?si=wyx1BKNRMckJRbfE', N'./assets/images/avtar-2.jpeg', 210, CAST(N'2012-11-02' AS Date), N'Present')
INSERT [dbo].[movies] ([movie_id], [title], [description], [trailer_url], [poster_url], [duration], [release_date], [status]) VALUES (6, N'Knives Out', N'Knives Out is a 2019 American mystery film written and directed by Rian Johnson, and produced by Johnson and Ram Bergman. It follows a master detective investigating the death of the patriarch of a wealthy, dysfunctional family. ', N'https://youtu.be/qGqiHJTsRkQ?si=YE9vCFyMcrkAjweh', N'./assets/images/m3.jpg', 152, CAST(N'2009-10-04' AS Date), N'Present')
INSERT [dbo].[movies] ([movie_id], [title], [description], [trailer_url], [poster_url], [duration], [release_date], [status]) VALUES (7, N'Rocketman', N'The film follows John in his early days in England as a prodigy at the Royal Academy of Music through his musical partnership with Taupin, and is titled after John 1972 song "Rocket Man". ', N'https://youtu.be/mpOGT3GTO84?si=m7DY49WZGpAGcUq4', N'./assets/images/n3.jpg', 190, CAST(N'2018-03-09' AS Date), N'Present')
INSERT [dbo].[movies] ([movie_id], [title], [description], [trailer_url], [poster_url], [duration], [release_date], [status]) VALUES (8, N'Doctor Sleep', N'Doctor Sleep is a 2019 American supernatural horror film written and directed by Mike Flanagan. It is based on the 2013 novel of the same name by Stephen King, a sequel to King 1977 novel The Shining. The film, which also serves as a direct sequel to the 1980 film adaptation. ', N'https://youtu.be/BOzFZxB-8cw?si=aftNf86t4famzTgW', N'./assets/images/m2.jpg', 135, CAST(N'2019-12-24' AS Date), N'Present')
INSERT [dbo].[movies] ([movie_id], [title], [description], [trailer_url], [poster_url], [duration], [release_date], [status]) VALUES (9, N'Toy Story 4', N' It is the fourth and final installment in Pixar Toy Story series and the sequel of Toy Story 3 (2010). ', N'https://youtu.be/LDXYRzerjzU?si=e3b4ZU6hCfkCjUic', N'./assets/images/m8.jpg', 220, CAST(N'2015-10-14' AS Date), N'Future')
INSERT [dbo].[movies] ([movie_id], [title], [description], [trailer_url], [poster_url], [duration], [release_date], [status]) VALUES (10, N'Mulan', N'Mulan is a responsible young woman, seen as a fearless warrior, leader, and beloved role model among her people, both men, and women. ', N'https://youtu.be/KK8FHdFluOQ?si=gf5gKBa2izo2aRyl', N'./assets/images/n2.jpg', 240, CAST(N'2019-09-22' AS Date), N'Future')
